INSERT INTO `wemall_document` VALUES ('1', '2014-02-21 18:26:18', '\0', '<p>\r\n	涓㈣喘杩浣褰搞\r\n</p>\r\n<p>\r\n	浜告ㄥ瑕朵慨规璁锛璁涓达灏浼ㄧ稿抽〉涓甯濡ㄤ瑰ㄧ瀹癸ㄥ涓诲ㄥ姝浣跨ㄥ㈣喘°濡ㄧ户缁浣跨ㄦ★瑙涓烘ュ璁淬\r\n</p>\r\n<p>\r\n	涓濡涓浠讳涓绉褰锛告涓缁姝㈠ㄦ渚¤ユ锛\r\n</p>\r\n1 ㄦ渚涓浜鸿涓瀹锛<br />\r\n2ㄨ璁瑙瀹锛<br />\r\n3 ф垮涓荤￠ㄩㄧ绠¤姹锛<br />\r\n4歌や负ㄧ琛涓鸿㈣喘℃ц川姹规褰\r\n<p>\r\n	灏界℃璁藉朵瑙瀹锛镐跺浠ラ剁姝㈡璁\r\n</p>\r\n<p>\r\n	浜哥姝㈡璁╀浼濡ㄥ虫稿芥ユㄦ璁缁姝㈠ㄨ璁告搴浜浠讳朵┿\r\n</p>\r\n<p>\r\n	ㄧ瑙ｅ苟瀹ㄦュ锛告琛瀵瑰㈣喘璧婧浣涓绾垮\r\n</p>', 'group', '㈣喘璁');
INSERT INTO `wemall_document` VALUES ('32768', '2013-09-17 23:24:19', '\0', '<p>\r\n	瑰ㄦ疯ょ璇绘ㄦ锋″璁(涓绉般璁) 涓℃俱らㄦュ璁℃撅ㄦ浣跨ㄦ缃绔渚稿虫°ㄧ浣跨ㄨ涓哄瑙涓哄规璁ュ锛骞跺ュ璁椤规℃剧绾 <br />\r\n<br />\r\n<strong>涓瀹涔</strong>\r\n</p>\r\n<ol>\r\n	<li>\r\n		\"ㄦ\"绗璁瑙瀹′欢锛靛缃绔绉瑙℃撅浣涓浜璁锛锛骞朵娇ㄦ缃绔涓浜烘烘\r\n	</li>\r\n	<li>\r\n		\"瀹\"ㄦ缃绔涓哄╁ㄦ枫\"涔板\"ㄦ缃绔璐涔扮╁ㄦ枫\r\n	</li>\r\n	<li>\r\n		\"浜\"涔板舵规瀹舵荤浜ゆ瑕姹锛ㄧ瑰堕村烘浼浜ゆ′欢锛寰渚舵虹′欢璐涔拌ヤ氦╁┿\r\n	</li>\r\n</ol>\r\n<p>\r\n	<br />\r\n<br />\r\n<strong>浜ㄦ疯</strong><br />\r\n<br />\r\n绗涓′欢涔涓浜哄瀹浣界宠锋涓烘缃绔ㄦ凤浠ヤ娇ㄦ缃绔°\r\n</p>\r\n<ol>\r\n	<li>\r\n		骞存弧宀锛骞跺锋姘浜╄藉姘浜琛涓鸿藉朵汉锛\r\n	</li>\r\n	<li>\r\n		婊″宀锛浣や汉锛浣涓浠浜舵锛浜浠ヤ功㈠朵汉锛\r\n	</li>\r\n	<li>\r\n		规涓芥寰璁剧版寰娉瑙/瑙绔绔骞跺娉瀛ㄧ搞浼浜涓浣绀惧㈢缁朵缁缁\r\n	</li>\r\n</ol>\r\n<p>\r\n	<br />\r\n姘浜琛涓鸿藉浜恒舵浜琛涓鸿藉浜轰互缁ユ瑰缁ヨ肩缁缁涓褰娉ㄥ涓烘缃绔ㄦ锋瓒杩舵浜╂琛涓鸿藉翠浜浜ゆ锛朵缃绔涔寸璁濮锛缃绔涓缁帮绔虫敞璇ョㄦ凤骞惰拷绌跺朵娇ㄦ缃绔\"\"涓娉寰璐ｄ换<br />\r\n<br />\r\n<strong>涓.ㄦ风╁涔</strong>\r\n</p>\r\n<ol>\r\n	<li>\r\n		ㄦ锋规璁瑙瀹缃绔甯稿宠锛╃ㄦ缃绔缃涓浜ゆ骞冲扮诲╁甯浜ゆ淇℃ヨ㈢╁淇℃璐涔扮╁涓朵ㄦ疯㈢╁涔板ㄦ缃绔绀惧哄甯缃绔虫椿ㄥ浜缃绔渚朵宠璁淇℃°\r\n	</li>\r\n	<li>\r\n		ㄦ锋规瑕存瑰浜ゆ瀵ㄦ峰瀵逛互璇ョㄦ峰杩琛娲诲ㄥ浜浠惰ㄩㄨ矗浠汇\r\n	</li>\r\n	<li>\r\n		ㄦ锋涔＄‘淇缃绔渚浠讳璧娉ㄥ淇℃瀹纭锛浣涓浜瀹濮韬浠借枫绯荤佃板跨绛淇璇缃绔朵ㄦ峰浠ラ杩涓杩拌绯绘瑰涓宸辫琛绯汇讹ㄦ蜂涔″ㄧ稿宠瀹存跺舵存版虫敞璧\r\n	</li>\r\n	<li>\r\n		ㄦ蜂寰浠ヤ换浣褰㈠杞璁╂浠浜轰娇ㄨ宸卞ㄦ缃绔ㄦ峰枫\r\n	</li>\r\n	<li>\r\n		ㄦ锋涔＄‘淇ㄦ缃绔缃涓浜ゆ骞冲颁诲╁甯浜ゆ淇℃瀹纭锛璇瀵兼с\r\n	</li>\r\n	<li>\r\n		ㄦ蜂寰ㄦ缃绔缃涓浜ゆ骞冲颁拱藉剁姝㈤堕╁涓寰涔板渚电浠浜虹ヨ浜ф朵娉╁锛涔涓寰涔板杩绀句卞╃遍寰风╁\r\n	</li>\r\n	<li>\r\n		ㄦ蜂寰ㄦ缃绔甯绫昏娉杩瑙淇℃浣涓浜╁淇℃浜ゆ淇℃绀惧哄瀛╁瑷锛搴虹瑷锛璇浠峰瀹圭\r\n	</li>\r\n	<li>\r\n		ㄦ峰ㄦ缃绔浜ゆ涓搴褰靛璇瀹淇＄ㄥ锛涓寰浠ュ共棰绾电╁浠锋肩涓姝ｅ绔浜瑰颁贡缃涓浜ゆ绉╁锛涓寰浠浜涓缃涓浜ゆ崇涓褰琛涓猴涓寰ㄤ氦骞冲颁甯浠讳杩娉淇℃\r\n	</li>\r\n	<li>\r\n		ㄦ蜂搴涓姝ｅ娈碉浣涓浜浜ゆ浜㈠ソ璇绛瑰锛楂韬浠浜轰俊ㄥ害锛ㄤ姝ｅ娈垫舵璇浠峰朵ㄦ凤浣朵ㄦ蜂俊ㄥ害\r\n	</li>\r\n	<li>\r\n		ㄦ锋胯鸿宸卞ㄤ娇ㄦ缃绔缃涓浜ゆ骞冲板界琛涓洪靛藉舵寰娉瑙缃绔稿宠瀹浠ュ绉绀句卞╃遍寰枫瀵逛浠讳娉寰锛ㄦ峰浠ヨ宸辩涔绔挎稿娉寰璐ｄ换\r\n	</li>\r\n	<li>\r\n		ㄦ峰ㄦ缃绔缃涓浜ゆ杩绋涓濡涓朵ㄦ峰浜ゆ浜х绾绾凤浠ヨ锋缃绔浠涓浜浠ュ璋ㄦ峰板朵ㄦ锋杩娉杩璁琛涓猴浠ュ缃绔涓炬ャ濡ㄦ峰缃涓浜ゆ涓朵ㄦ蜂骇璇璁肩锛ㄦ锋杩告ㄩㄨ姹缃绔渚稿宠\r\n	</li>\r\n	<li>\r\n		ㄦ峰琛挎浜ゆ浜х稿宠垂锛骞朵娉绾崇\r\n	</li>\r\n	<li>\r\n		缁缃绔涔㈠璁革ㄦ蜂寰灏缃绔璧浠ュㄤ氦骞冲颁灞绀虹浠讳淇℃浠ュ躲淇广缈昏绛褰㈠朵琛浣寮灞绀恒\r\n	</li>\r\n	<li>\r\n		ㄦ峰ユ舵ヨ缃绔淇℃锛浣涓浜娲诲ㄤ俊浜ゆ淇℃淇淇℃绛\r\n	</li>\r\n</ol>\r\n<p>\r\n	<br />\r\n<br />\r\n<strong> 缃绔╁涔</strong>\r\n</p>\r\n<ol>\r\n	<li>\r\n		\r\n缃绔涓浼缁涔涓\"\"锛浠涓虹ㄦ锋渚涓涓淇℃浜ゆ杩琛╁涔板骞冲帮褰涔板逛寸浜ゆ濯浠锛涔颁富涓荤浠ｇ浼  \r\n浜恒涓荤缁ュ崇郴浜恒甯ㄦ缃绔涓浜ゆ╁ㄦ疯琛涓浼杩琛浜ゆ╁锛骞堕缃绔瀵逛ㄦ峰荤╁渚淇℃涓绔杩绋锛\r\n缃绔涓浠ョ瑙у讹浜涓浠ョ╁浜ゆ杩绋锛杩浠娆俱娆俱垫淇跺浜ゆ浜椤癸涓涓挎浜ゆ╁瀛ㄥ璐ㄣ╀典互浜ゆ\r\n  瑰饱琛浜ゆ璁藉浜х浠讳璐ｄ换锛瀵逛虹板ㄦ涓╁璐ㄣ瀹ㄦф娉э缃绔涓浜淇璇\r\n	</li>\r\n	<li>\r\n		缃绔涔″ㄧ版姘村钩虹涓纭淇翠釜缃涓浜ゆ骞冲扮姝ｅ父杩琛锛灏藉垮′腑灏涓堕撮跺ㄦ堕村锛淇璇ㄦ风涓浜ゆ娲诲ㄧ椤哄╄琛\r\n	</li>\r\n	<li>\r\n		缃绔涔″圭ㄦ峰ㄦ敞浣跨ㄦ缃绔缃涓浜ゆ骞冲颁腑扮棰靛朵哄澶\r\n	</li>\r\n	<li>\r\n		缃绔瀵圭ㄦ风娉ㄥ璧杩琛ラ锛瀵瑰ㄤ换浣棰娉ㄥ璧锛缃绔洪ヨ㈤ㄦ峰苟瑕姹ㄦ峰鸿В规ｏ存ュ哄缃ょ澶\r\n	</li>\r\n	<li>\r\n		\r\n峰ㄦ缃绔缃涓浜ゆ涓朵ㄦ蜂骇绾绾风锛ㄦ烽杩告ㄩㄦ琛块ㄩㄤф瀹绋搴瑕姹缃绔渚稿宠锛缃绔灏绉骞舵渚宠锛ㄦ峰绾\r\n绾峰ユ缃绔锛缃绔ユ绾绾锋电锛缁瀹℃稿锛缃绔杩靛浠跺佃绯诲绾绾峰逛瑙ｇ绾锋碉骞跺浜瑙ｇ甸杩靛浠朵搁ュ \r\n 广\r\n	</li>\r\n	<li>\r\n		缃涓浜ゆ骞冲扮规э缃绔娌℃涔″规ㄦ风娉ㄥ璧浜ゆ琛涓轰互涓浜ゆ崇朵浜椤硅琛浜瀹℃ワ浣濡浠ヤ褰锛缃绔剁ㄦ风娲诲ㄣㄦ锋稿宠鸿ャ朵腑姝颁腑姝㈠缁璇ョㄦ锋渚★\r\n		<ul>\r\n			<li>\r\n				ㄦ疯璁琚绾冲ユ璁浠讹\r\n			</li>\r\n			<li>\r\n				瀛ㄧㄦ锋朵绗涓归ユ缃绔锛璁や负涓ㄦ锋蜂浜ゆ浜椤瑰ㄨ娉涓褰琛涓猴骞舵渚稿宠锛缃绔娉绯诲拌ョㄦ锋歌楠璇璇ョㄦ峰缃绔渚浠讳璧锛\r\n			</li>\r\n			<li>\r\n				瀛ㄧㄦ锋朵绗涓归ユ缃绔锛璁や负涓ㄦ锋蜂浜ゆ浜椤瑰ㄨ娉涓褰琛涓猴骞舵渚稿宠缃绔浠ユ涓涓浜ゆヨ姘村钩瀵圭稿冲瀹硅琛ゅ锛浠ユ捐や负杩浜瀹规琛涓哄藉规缃绔ㄦ锋缃绔璐㈠℃澶辨娉寰璐ｄ换\r\n			</li>\r\n		</ul>\r\n	</li>\r\n	<li>\r\n		ㄥ缃缁娆鸿琛ㄤ腑锛淇ゅ箍澶хㄦ峰╃锛褰ㄦ蜂妇ヨ宸变氦藉ㄦ鸿浜х浜ゆ浜璁讹缃绔杩琛ㄩ㈠ゆ跺荤稿崇ㄦ疯处凤骞舵稿瑰浜浜鸿韩浠借瑕姹渚浜ゆ稿宠\r\n	</li>\r\n	<li>\r\n		规藉舵寰娉瑙璁瀹瑰缃绔＄浜瀹渚锛浠ヨゅㄦ峰ㄨ娉杩璁琛涓轰互ㄦ缃绔浜ゆ骞冲颁朵涓褰琛涓猴缃绔ㄦ缃绔浜ゆ骞冲板ㄧ绔涓浠ョ缁甯褰㈠甯ㄦ风杩娉琛涓猴骞舵朵哄ょ稿充俊锛椤诲寰ㄦ风\r\n	</li>\r\n	<li>\r\n		\r\n缃绔ㄤョㄦ风涓ゆ朵舵ф藉涓淇℃锛浣涓浜浠ヨ胯垂ㄤ负锛浠ョ浣淇＄ㄤ负锛瀛ㄦ鸿绛舵瀹癸涓缃\r\n  涓浜ゆ虫涓浠ヤ氦涓虹锛瀛ㄦ舵绔浠锋朵璇炬颁贡姝ｅ父浜ゆ绉╁绱锛璇ヤ俊杩卞╃戒弗瀹虫缃绔朵ㄦ峰娉╃\r\n	</li>\r\n	<li>\r\n		\r\n  锋浜缃绔瀹剁ㄧㄧ姘镐璐圭淇℃璁稿浣跨ㄦ╋缃绔瀵硅ユ╄琛锛渚姝ゆ缃绔(ㄩㄦㄤ唤)  \r\n浣跨ㄣ澶躲淇璁瑰甯缈昏ц灞绀虹ㄦ峰绀轰缃绔绫讳俊朵舵淳浣锛浠ョ板ㄥ凡ユュ寮浠讳褰㈠濯浣锛灏涓杩\r\n  淇℃绾冲ュ朵浣\r\n	</li>\r\n</ol>\r\n<p>\r\n	<br />\r\n<br />\r\n<strong>浜＄涓缁姝</strong>\r\n</p>\r\n<ol>\r\n	<li>\r\n		\r\n  缃绔ㄦ锋跺稿虫¤垂ㄧ典锛缃绔琛ㄦ冲浠ヤ换浣  \r\n(浣涓浜缃绔璁や负ㄦ峰凡杩璁瀛㈡涔绮剧锛ㄦ峰ㄨ杩180澶╁诲缃绔绛)  \r\n缁姝㈠圭ㄦ风★骞朵淇瀛ㄦ峰ㄦ缃绔ㄩㄨ锛浣涓浜ㄦ蜂俊淇℃浜ゆ淇℃绛锛舵缃绔琛ㄦ冲锛ㄥ洪ユ涓洪\r\nョ典锛跺姝㈡渚ㄩㄦㄥ°＄姝㈠锛缃绔娌℃涔′负ㄦ蜂ㄦ疯涓涔稿崇浠讳淇℃锛杞浠讳鹃璇绘淇℃缁ㄦ\r\n  绗涓广姝ゅ锛缃绔涓灏辩姝㈠圭ㄦ风¤瀵圭ㄦ锋浠讳绗涓规挎浠讳璐ｄ换\r\n	</li>\r\n	<li>\r\n		濡ㄦ峰缃绔烘敞缃绔娉ㄥㄦ疯韩浠斤缁缃绔瀹℃稿锛辨缃绔娉ㄩ璇ユ敞ㄦ凤ㄦ峰宠Вや缃绔璁崇郴锛浣缃绔浠淇涓╋\r\n		<ul>\r\n			<li>\r\n				ㄦ锋敞锛缃绔淇璇ョㄦ风璧,浣涓浜浠ュㄦ疯搴鸿璧浜ゆ璁板绛\r\n			</li>\r\n			<li>\r\n				ㄦ锋敞锛濡ㄦ峰ㄦ敞ㄦ缃绔浜ゆ骞冲颁瀛ㄨ娉琛涓烘杩璁琛涓猴缃绔浠琛浣挎璁瑙瀹┿\r\n			</li>\r\n		</ul>\r\n	</li>\r\n	<li>\r\n		濡瀛ㄤ碉缃绔浠ラ杩娉ㄩㄦ风瑰缁姝㈡★\r\n		<ul>\r\n			<li>\r\n				ㄧㄦ疯璁稿宠瀹讹缃绔缁姝㈠璇ョㄦ锋渚°缃绔灏ㄤ腑℃堕ョㄦ枫浣濡璇ョㄦ峰ㄨ缃绔缁姝㈡渚″锛涓娆＄存ユ存ユ浠ヤ浜哄涔娉ㄥ涓烘缃绔ㄦ风锛缃绔娆″