INSERT INTO `wemall_document` VALUES ('65537', '2013-09-17 23:26:43', '\0', '<p>\r\n	浣跨ㄦ告℃椤婚靛℃惧′欢<br />\r\n<br />\r\n1.ㄦ疯<br />\r\n哥′ㄦ寰涓藉绛捐㈠锋娉寰绾涓浜烘渚骞\r\n浠卞朵娇ㄣㄤ跺杩拌瀹涓锛哥′18ㄥ浠ヤ琚涓存舵涓姝㈢ㄦ锋渚濡ㄤ璧硷璇峰夸娇ㄦ哥°姝ゅ锛ㄧ\r\n甯凤淇＄ㄨ浠凤ㄦ峰涓寰朵硅浆璁╂哄澶锛镐规舵夸腑姝㈡缁姝㈡ㄧ甯风┿<br />\r\n<br />\r\n2.ㄧ璧锛浣涓浜娣诲浠讳锛涓寰锛<br />\r\n*锋娆鸿с涓纭疯瀵兼э<br />\r\n*渚电浠讳绗涓硅浣涓╂涓绉瀵朵涓╂琛ㄦ绉锛<br />\r\n*杩浠讳ㄧ娉寰娉瑙锛浣涓浜冲哄ｇ″躲娑璐硅淇ゃ涓姝ｅ绔浜娉姝ц璐告渚/骞宠锤娉寰娉寰娉瑙锛锛<br />\r\n*渚杈辨璇借挨浠浜猴渚靛充浜哄娉瀹癸<br />\r\n*娣绉姐叉璧村舵缃瀹癸<br />\r\n*界村瑰ゃ涓╁奖绉瀵缁ヨЕ寰ㄤ换浣绯荤版涓浜鸿浠讳姣规渚ㄩ┈瀹剁稿脊よ澶娲昏褰╄磋杞浠舵朵佃绋搴锛<br />\r\n<br />\r\n3.杩绾<br />\r\n濡浠ヤ褰锛稿介舵ㄧ娲诲ㄣ绔冲ゆㄧ哥ぞ哄烘虫ㄧ琛涓虹璀鸿ャ朵腑姝颁腑姝㈡缁姝㈡ㄧㄦ疯煎缁ㄦ渚★<br />\r\n(a)ㄨ璁绾冲ユ璁浠讹<br />\r\n(b)告娉歌楠璇ㄥ告渚浠讳璧锛<br />\r\n(c)哥镐俊ㄧ琛涓哄藉规ㄣ哥ㄦ锋搁澶辨娉寰璐ｄ换<br />\r\n<br />\r\n4.璐ｄ换<br />\r\n\r\n搞哥宠稿稿冲浣哥渚搴ㄤ换浣典涓灏卞哥缃绔哥℃璁浜х涓涔崇╂鼎澶辨浠讳瑰存\r\nх瀹筹璁轰互浣绉瑰浜х锛蹇斤挎浠讳璐ｄ换ㄥㄥ氨ㄨ韬琛涓轰娉у挎璐ｄ换ㄥ锛稿哥宠稿稿\r\n瀹浣瀵规哥ㄦ风琛涓虹娉у浜х浠讳缁涓挎璐ｄ换<br />\r\n<br />\r\n5.浠ｇ崇郴<br />\r\nㄦ峰告绔癸璁寤虹涔娌℃绔浠讳浠ｇ浼ャ涓涓绘硅哥ュ崇郴镐涓瀵逛换浣ㄦ峰剁涓浜ゆ琛涓哄烘绀烘榛璁哥ㄨ胯烘淇<br />\r\n<br />\r\n6.涓瑙瀹<br />\r\n璁ㄦ归㈠涓浜烘卞芥寰绠¤璁瑙瀹茬锛濡璁浠讳瑙瀹琚瑁瀹涓烘涓ц锛璇ヨ瀹琚よ朵℃惧浜浠ユц\r\n</p>', 'store', '寮搴璁');
